import React from 'react';
import style from './Card.module.scss';

const Card = (props) => {
	return (
		<div className="card">
			<div className="card-image">
				<img src={props.image} alt="" />
			</div>
			<div className="card-content">
				
			</div>
		</div>

	);
}
export default Card;
